import React from "react";
import { Link } from "react-router-dom";
import "./tailwind.css";

import bird from "./images/daily/image.webp";

export const Top = () => {
  return (
    <>
      <div>
        <div class="flex">
          <div class="w-3/4">
            <img class="bg-cover bg-center" src={bird} alt="imgaes" />
          </div>
          <div class="flex flex-col">
            <p class="">
              日報を共有
              <br />
              新たな発見に出会う
            </p>
            <Link class="p-2 bg-blue-300 rounded-lg text-white" to="/daily">
              日報を見る
            </Link>
          </div>
        </div>
      </div>
    </>
  );
};
